import React, { useState } from "react";
import ReactDOM from "react-dom";

function Celsius() {
  return <input type="number" name="celsius" />;
}

function Fahrenheit() {
  return <input type="number" name="fahrenheit" />;
}

function App() {
  return (
    <div>
      <Celcius />
      <Fahrenheit />
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
